import React, { useEffect, useRef, useState } from 'react';
import * as THREE from 'three';
import algo from './data'
import { Canvas } from '@react-three/fiber';
import { OrbitControls } from 'three/examples/jsm/controls/OrbitControls.js';
import { Rhino3dmLoader } from 'three/examples/jsm/loaders/3DMLoader'

const RhinoViewer = () => {
    const [rhinoIoRes, setRhinoIoRes] = useState(sessionStorage.getItem('rhino-io-res'));
    const [rhinoSolveRes, setRhinoSolveRes] = useState(sessionStorage.getItem('rhino-solve-res'));
    const [respuesta3, setRespuesta3] = useState("");
    const [dataModelo, setDataModelo] = useState("");

    const mountRef = useRef(null);

    useEffect(() => {
        // Configuración de la escena Three.js
        const scene = new THREE.Scene();
        scene.background = new THREE.Color(0.9, 0.9, 0.9);
        const camera = new THREE.PerspectiveCamera(75, window.innerWidth / window.innerHeight, 0.1, 1000);
        const renderer = new THREE.WebGLRenderer({ antialias: true });

        // Agregar luces
        const ambientLight = new THREE.AmbientLight(0xffffff, 0.5); // Luz ambiental
        scene.add(ambientLight);

        const directionalLight = new THREE.DirectionalLight(0xffffff, 1); // Luz direccional
        directionalLight.position.set(5, 5, 5).normalize();
        scene.add(directionalLight);

        const pointLight = new THREE.PointLight(0xffffff, 1, 100); // Luz puntual
        pointLight.position.set(50, 50, 50);
        scene.add(pointLight);

        // Configurar controles orbitales
        const controls = new OrbitControls(camera, renderer.domElement);
        controls.enableDamping = true; // para un movimiento más suave
        controls.dampingFactor = 0.25;
        controls.screenSpacePanning = false;

        renderer.setSize(window.innerWidth, window.innerHeight);
        renderer.setPixelRatio(window.devicePixelRatio);

        mountRef.current.appendChild(renderer.domElement);

        const loader = new Rhino3dmLoader()
        loader.setLibraryPath('https://unpkg.com/rhino3dm@8.0.0-beta3/')

        const loadIO = async () => {
            console.log(`Rhino IO Res ${rhinoIoRes}`)
            if (!rhinoIoRes || rhinoIoRes == 'undefined' || rhinoIoRes == '' || rhinoIoRes == null) {
                try {

                    console.log(`Rhino IO Res ${rhinoIoRes}`)
                    const myHeaders = new Headers();
                    myHeaders.append("RhinoComputeKey", "gravitacional");
                    myHeaders.append("Content-Type", "application/json");

                    const raw = JSON.stringify({ "absolutetolerance": 0.01, "angletolerance": 1.0, "modelunits": "Meters", "dataversion": 8, "algo": "", "pointer": null, "cachesolve": false, "values": [], "warnings": [], "errors": [] });

                    const requestOptions = {
                        method: "POST",
                        headers: myHeaders,
                        body: raw,
                        redirect: "follow"
                    };

                    let result1 = ""
                    await fetch("http://rhino-compute-loadbalancer-824415098.us-east-1.elb.amazonaws.com/io", requestOptions)
                        .then((response) => response.json())
                        .then((result) => result1 = JSON.stringify(result))
                        .catch((error) => console.error(error));

                    console.log(`Resultado 1: ${result1}`);
                    setRhinoIoRes(result1);
                    sessionStorage.setItem('rhino-io-res', result1);
                    console.log(`Rhino IO Res ${rhinoIoRes}`)
                    if (rhinoIoRes && rhinoIoRes !== 'undefined' && rhinoIoRes !== '' && rhinoIoRes !== null) {
                        loadGeometry();
                    }

                } catch (error) {
                    console.error('Error al cargar entradas y salidas:', error);
                }
            } else if (rhinoIoRes && rhinoIoRes !== 'undefined' && rhinoIoRes !== '' && rhinoIoRes !== null) {
                loadGeometry();
            }
        }

        // Función para cargar la geometría desde Rhino Compute
        const loadGeometry = async () => {
            if (!rhinoSolveRes || rhinoSolveRes == 'undefined' || rhinoSolveRes == '' || rhinoSolveRes == null) {
                try {

                    const myHeaders = new Headers();
                    myHeaders.append("RhinoComputeKey", "gravitacional");
                    myHeaders.append("Content-Type", "application/json");

                    console.log('Rhino IO RES: ', rhinoIoRes);

                    // const raw = rhinoIoRes;
                    // console.log(raw)
                    const raw = JSON.stringify({ "absolutetolerance": 0.01, "angletolerance": 1.0, "modelunits": "Meters", "dataversion": 7, "algo": null, "pointer": "md5_767237D7DEA1C1C93F3C78EDCA3487DF", "cachesolve": true, "values": [{ "ParamName": "Radius", "InnerTree": { "{0}": [{ "type": "System.Double", "data": "10.0" }] } }, { "ParamName": "Count", "InnerTree": { "{0}": [{ "type": "System.Double", "data": "100.0" }] } }, { "ParamName": "Length", "InnerTree": { "{0}": [{ "type": "System.Double", "data": "10.0" }] } }], "warnings": [], "errors": [] }

                    );

                    const requestOptions = {
                        method: "POST",
                        headers: myHeaders,
                        body: raw,
                        redirect: "follow"
                    };

                    let result2 = ""
                    await fetch("http://rhino-compute-loadbalancer-824415098.us-east-1.elb.amazonaws.com/grasshopper", requestOptions)
                        .then((response) => response.json())
                        .then((result) => result2 = JSON.stringify(result))
                        .catch((error) => console.error(error));

                    setRhinoSolveRes(result2);
                    console.log(result2);
                    sessionStorage.setItem('rhino-solve-res', result2);

                    if (rhinoSolveRes && rhinoSolveRes !== 'undefined' && rhinoSolveRes !== '' && rhinoSolveRes !== null) {
                        collectResults();
                    }

                } catch (error) {
                    console.error('Error al cargar la geometría:', error);
                }
            } else if (rhinoSolveRes && rhinoSolveRes !== 'undefined' && rhinoSolveRes !== '' && rhinoSolveRes !== null) {
                collectResults();
            }
        };

        const collectResults = async () => {

            // const values = responseJson.values
            console.log("Collect results")


            fetch('http://localhost:3100/api/rhino/compute', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(JSON.parse(rhinoSolveRes))
            })
                .then(response => {
                    if (!response.ok) {
                        throw new Error('Error en la respuesta');
                    }
                    return response.arrayBuffer();  // Recibirlo como ArrayBuffer
                })
                .then(buffer => {
                    console.log('ArrayBuffer Length:', buffer.byteLength);  // Debería ser mayor que 0
                    console.log('Buffer: ', buffer);
                    setRespuesta3(buffer.byteLength);

                    // Usar loader.parse con el buffer
                    loader.parse(buffer, (object) => {
                        console.log(object)
                        scene.add(object);

                        camera.position.z = 10;
                        renderer.render(scene, camera);
                    }, (error) => {
                        console.error('Error cargando el objeto 3DM:', error);
                    });
                })
                .catch(error => console.error('Error:', error));
        }

        const showSpinner = (enable) => {
            if (enable)
                document.getElementById('loader').style.display = 'block'
            else
                document.getElementById('loader').style.display = 'none'
        }

        loadIO();

        const animate = () => {
            requestAnimationFrame(animate);
            controls.update(); // Necesario para los controles orbitales
            renderer.render(scene, camera);
        };

        animate();

        return () => {
            // Cleanup cuando el componente se desmonta
            if (mountRef.current) {
                mountRef.current.removeChild(renderer.domElement);
            }
        };
    });

    return <div ref={mountRef}>
        <div style={{ padding: "100px" }} >
            <div><p><b>Respuesta 1 (I/O):</b> {rhinoIoRes}</p>
                {/* <button className='btn btn-primary' onClick={() => loadIO}>Request I/O</button> */}
            </div>
            <div><p style={{ maxHeight: "200px", overflowY: "scroll" }}><b>Respuesta 2 (Grasshopper):</b> {rhinoSolveRes}</p>
                {/* <button className='btn btn-primary' onClick={() => loadGeometry}>Request Grasshpper</button> */}
            </div>
            <div><b>Respuesta 3 (Peso archivo 3DM):</b> {JSON.stringify(respuesta3)}</div>
        </div>



    </div >;
};

export default RhinoViewer;